    setTimeout(() => {
        let sliderItem = svgcontainer.querySelectorAll(".who_slider_item");
        let whoSvgTl = gsap.timeline({ repeat: -1, defaults: { ease: "none" } });
        whoSvgTl.set(svgcontainer, { opacity: 1 });

        sliderItem.forEach((item, i) => {
            whoSvgTl.to(item, { opacity: 1, duration: 0.3, });
            if (i > 0) {
                whoSvgTl.to(sliderItem[i - 1], { opacity: 0 }, "-=0.25");
            }
            let n_path = item.querySelectorAll("path");
            n_path.forEach((i_cnt) => {
                let length = i_cnt.getTotalLength();
                i_cnt.style.fill = "none";
                i_cnt.style.strokeDasharray = length + 1;
                i_cnt.style.strokeDashoffset = length + 1;

                whoSvgTl.set(i_cnt, {
                    strokeDashoffset: length + 1
                })
            });

            whoSvgTl.to(item.querySelector(".linedraw"), {
                duration: 2,
                strokeDashoffset: 0,
                ease: "none"
            })
                .to(item.querySelector(".linedraw"), {
                    opacity: 0,
                    duration: 2
                }, "-=0.25")
                .to(item.querySelectorAll(".restLine path"), {
                    duration: 5,
                    strokeDashoffset: 0,
                    ease: "none"
                }, "-=1.5");
        })
        // whoSvgTl.pause();
        // ScrollTrigger.create({
        //     trigger: svgcontainer,
        //     start: "top center",
        //     animation: whoSvgTl,
        // });
    }, 300);
